description:
Category	Feature

Director	Jaxodema
Starring	Riley Reid, Jesse Jane, Raven Bay, Gulliana Alexis

Digital Playground's Jesse Jane is really good at being bad in this dangerous thriller involving sex and greed. A master of manipulation, Jesse turns on the charm to stay on top. She lands in the arms of an innocent man and seduces him with her flawless body. Her animalistic sex appeal is undeniable as it penetrates deeply into his loins until he cannot resist and succumbs to her every wish. But before the story comes to a magnificent end, karma catches up with the buxom blonde, revealing her heinous acts of manipulation, robbery, and murder. Lollipop is a sure thrill ride with an amazing cast!
This is the only Jaxodema video.

